    render() {
        return (
            <div>
                <BrowserRouter>
                    <Routes>
                        <Route path="/" element={<NavBar user={this.state.user} parnetCallback={this.handleCallback}/>}>
                            <Route index element={<Home/>} />
                            <Route path="DailyLeaderboard" element={<DailyLeaderBoard/>} />
                            <Route path="WeeklyLeaderboard" element={<WeeklyLeaderboard/>} />
                        </Route>
                    </Routes>
                </BrowserRouter>

                <form onSubmit={this.createUser}>
                    <label>
                        Email:
                        <input type="text" value={this.state.value} onChange={this.handleChange} />
                    </label>
                    <input type="submit" value="Add Test User" />
                </form>


            </div>

        );
    }
}

export default App;
